import {
  Button,
  Typography,
  TextField,
  FormControl,
  Select,
  MenuItem,
  Grid,
} from "@material-ui/core";

const EnterMeeting = () => {
  return (
    <React.Fragment>
      <Typography variant="h6">
        Please enter your coupon code to start the meeting
      </Typography>

      <TextField
        multiline
        variant="outlined"
        //onChange={handleDescriptionChange}
      />

      <Button>Enter</Button>
    </React.Fragment>
  );
};

export default EnterMeeting;
